    "dict_show_word_freq_body": {
      "en": "DaKanji uses word frequency to rank its dictionary entries. This word frequency is an estimation of a word's usage and is based on different data sources:\n\n* Wikipedia, representing encyclopedic text\n* Subtitles, from OPUS OpenSubtitles 2018 and SUBTLEX\n* Web text, from OSCAR\n* Twitter, representing short-form social media\n* Reddit, representing potentially longer Internet comments\n\nThe number shown in DaKanji is a variation on the actual word frequency called [Zipf frequency](https://en.wikipedia.org/wiki/Zipf%27s_law) that aims to return the word frequency on a human-friendly logarithmic scale. The Zipf frequency of a word is the base-10 logarithm of the number of times it appears per billion words. A word with Zipf value 6 appears once per thousand words, for example, and a word with Zipf value 3 appears once per million words.\nReasonable Zipf values are between 0 and 8, but the minimum Zipf value appearing in DaKanji is 1.0. We use 0 as the default Zipf value for words that do not appear in the data sources, although it should mean one occurrence per billion words.\n[Read more...](https://github.com/rspeer/wordfreq)",
      "de": "DaKanji verwendet ein MaÃŸ fÃ¼r die WorthÃ¤ufigkeit, um seine WÃ¶rterbucheintrÃ¤ge zu bewerten. Diese WorthÃ¤ufigkeit ist eine SchÃ¤tzung der Verwendung eines Wortes. Diese SchÃ¤tzung basiert auf verschiedenen Datenquellen:\nWikipedia, die enzyklopÃ¤dischen Text darstellt\nUntertitel, aus OPUS OpenSubtitles 2018 und SUBTLEX\nWebtext, aus OSCAR\nTwitter, stellvertretend fÃ¼r soziale Medien in Kurzform\nReddit, reprÃ¤sentiert potenziell lÃ¤ngere Internetkommentare\nDie angezeigte Zahl ist eine Variante der eigentlichen WorthÃ¤ufigkeit, die Zipf-HÃ¤ufigkeit, die darauf abzielt, die WorthÃ¤ufigkeit auf einer menschenfreundlichen logarithmischen Skala wiederzugeben. Die Zipf-HÃ¤ufigkeit eines Wortes ist der Logarithmus zur Basis 10, der angibt, wie oft das Wort pro Milliarde WÃ¶rter vorkommt. Ein Wort mit dem Zipf-Wert 6 kommt beispielsweise einmal pro tausend WÃ¶rter vor, und ein Wort mit dem Zipf-Wert 3 kommt einmal pro Million WÃ¶rter vor.\nAngemessene Zipf-Werte liegen zwischen 0 und 8, aber der minimale Zipf-Wert in DaKanji ist 1,0. Wir verwenden 0 als Standard-Zipf-Wert fÃ¼r WÃ¶rter, die in der gegebenen Wortliste nicht vorkommen, obwohl dies ein Vorkommen pro Milliarde WÃ¶rter bedeuten sollte.",
