      "it": "DaKanji utilizza la frequenza delle parole per classificare le voci del suo dizionario. La frequenza delle parole Ã¨ una stima dell'uso di una parola e si basa su diverse fonti di dati:\n\n* Wikipedia, che rappresenta un testo enciclopedico\n* Sottotitoli, da OPUS OpenSubtitles 2018 e SUBTLEX\n* Testo web, da OSCAR\n* Twitter, che rappresenta i social media in forma breve\n* Reddit, che rappresenta i commenti potenzialmente piÃ¹ lunghi su Internet\n\nIl numero mostrato in DaKanji Ã¨ una variante della frequenza effettiva delle parole, chiamata [frequenza Zipf] (https://en.wikipedia.org/wiki/Zipf%27s_law), che mira a restituire la frequenza delle parole su una scala logaritmica di facile comprensione. La frequenza Zipf di una parola Ã¨ il logaritmo in base 10 del numero di volte in cui appare su un miliardo di parole. Ad esempio, una parola con valore Zipf 6 appare una volta ogni mille parole, mentre una parola con valore Zipf 3 appare una volta ogni milione di parole.\nI valori Zipf ragionevoli sono compresi tra 0 e 8, ma il valore Zipf minimo che appare in DaKanji Ã¨ 1,0. Utilizziamo 0 come valore Zipf predefinito per le parole che non compaiono nelle fonti di dati, anche se dovrebbe significare un'occorrenza ogni miliardo di parole.\n[Per saperne di piÃ¹...](https://github.com/rspeer/wordfreq)",
      "fr": "Le DaKanji utilise la frÃ©quence des mots pour classer les entrÃ©es de son dictionnaire. Cette frÃ©quence de mots est une estimation de l'utilisation d'un mot et est basÃ©e sur diffÃ©rentes sources de donnÃ©es :\n\n* WikipÃ©dia, qui reprÃ©sente un texte encyclopÃ©dique\n* Sous-titres, provenant d'OPUS OpenSubtitles 2018 et SUBTLEX\n* Texte Web, Ã  partir d'OSCAR\n* Twitter, qui reprÃ©sente les mÃ©dias sociaux de courte durÃ©e\n* Reddit, reprÃ©sentant des commentaires Internet potentiellement plus longs\n\nLe nombre indiquÃ© dans DaKanji est une variante de la frÃ©quence rÃ©elle des mots appelÃ©e [frÃ©quence de Zipf] (https://en.wikipedia.org/wiki/Zipf%27s_law) qui vise Ã  restituer la frÃ©quence des mots sur une Ã©chelle logarithmique conviviale. La frÃ©quence de Zipf d'un mot est le logarithme en base 10 du nombre de fois qu'il apparaÃ®t par milliard de mots. Un mot ayant une valeur de Zipf de 6 apparaÃ®t une fois pour mille mots, par exemple, et un mot ayant une valeur de Zipf de 3 apparaÃ®t une fois pour un million de mots.\nLes valeurs raisonnables de Zipf se situent entre 0 et 8, mais la valeur minimale de Zipf apparaissant dans le DaKanji est de 1,0. Nous utilisons 0 comme valeur Zipf par dÃ©faut pour les mots qui n'apparaissent pas dans les sources de donnÃ©es, bien que cela signifie une occurrence par milliard de mots.\n[Lire la suite...] (https://github.com/rspeer/wordfreq)",
      "es": "DaKanji utiliza la frecuencia de palabras para clasificar las entradas de su diccionario. Esta frecuencia de palabras es una estimaciÃ³n del uso de una palabra y se basa en diferentes fuentes de datos:\n\n* Wikipedia, que representa el texto enciclopÃ©dico.\n* SubtÃ­tulos, de OPUS OpenSubtitles 2018 y SUBTLEX\n* Texto web, de OSCAR\n* Twitter, que representa medios sociales breves\n* Reddit, que representa comentarios de Internet potencialmente mÃ¡s largos\n\nEl nÃºmero que se muestra en DaKanji es una variaciÃ³n de la frecuencia real de las palabras denominada [frecuencia Zipf](https://en.wikipedia.org/wiki/Zipf%27s_law), cuyo objetivo es obtener la frecuencia de las palabras en una escala logarÃ­tmica de fÃ¡cil comprensiÃ³n. La frecuencia Zipf de una palabra es el logaritmo en base 10 del nÃºmero de veces que aparece por cada mil millones de palabras. Una palabra con valor Zipf 6 aparece una vez por cada mil palabras, por ejemplo, y una palabra con valor Zipf 3 aparece una vez por cada millÃ³n de palabras.\nLos valores Zipf razonables estÃ¡n entre 0 y 8, pero el valor Zipf mÃ­nimo que aparece en DaKanji es 1,0. Utilizamos 0 como valor Zipf por defecto para las palabras que no aparecen en las fuentes de datos, aunque deberÃ­a significar una apariciÃ³n por cada mil millones de palabras.\n[Leer mÃ¡s...](https://github.com/rspeer/wordfreq)",
      "pl": "DaKanji uÅ¼ywa czÄ™stotliwoÅ›ci sÅ‚Ã³w, aby uszeregowaÄ‡ swoje hasÅ‚a sÅ‚ownikowe. Ta czÄ™stotliwoÅ›Ä‡ jest szacunkowÄ… ocenÄ… uÅ¼ycia sÅ‚owa i jest oparta na rÃ³Å¼nych ÅºrÃ³dÅ‚ach danych:\n\n* Wikipedia, reprezentujÄ…ca tekst encyklopedyczny\n* Napisy, z OPUS OpenSubtitles 2018 i SUBTLEX\n* Tekst internetowy, z OSCAR\n* Twitter, reprezentujÄ…cy media spoÅ‚ecznoÅ›ciowe o krÃ³tkiej formie\n* Reddit, reprezentujÄ…cy potencjalnie dÅ‚uÅ¼sze komentarze internetowe\n\nLiczba pokazana w DaKanji jest wariacjÄ… na temat rzeczywistej czÄ™stotliwoÅ›ci sÅ‚Ã³w zwanÄ… [CzÄ™stotliwoÅ›Ä‡ Zipfa](https://en.wikipedia.org/wiki/Zipf%27s_law), ktÃ³ra ma na celu zwrÃ³cenie czÄ™stotliwoÅ›ci sÅ‚Ã³w w przyjaznej dla czÅ‚owieka skali logarytmicznej. CzÄ™stotliwoÅ›Ä‡ Zipfa dla danego sÅ‚owa jest logarytmem podstawy 10 z liczby jego wystÄ…pieÅ„ na miliard sÅ‚Ã³w. Na przykÅ‚ad sÅ‚owo o wartoÅ›ci Zipf 6 pojawia siÄ™ raz na tysiÄ…c sÅ‚Ã³w, a sÅ‚owo o wartoÅ›ci Zipf 3 pojawia siÄ™ raz na milion sÅ‚Ã³w.\nRozsÄ…dne wartoÅ›ci Zipf sÄ… pomiÄ™dzy 0 a 8, ale minimalna wartoÅ›Ä‡ Zipf wystÄ™pujÄ…ca w DaKanji to 1.0. UÅ¼ywamy 0 jako domyÅ›lnej wartoÅ›ci Zipf dla sÅ‚Ã³w, ktÃ³re nie pojawiajÄ… siÄ™ w ÅºrÃ³dÅ‚ach danych, chociaÅ¼ powinno to oznaczaÄ‡ jedno wystÄ…pienie na miliard sÅ‚Ã³w.\n[Czytaj wiÄ™cej...](https://github.com/rspeer/wordfreq)"
